import React from 'react'
import styled from 'styled-components';

const BigButton = styled.button`
  color: #FFC759;
  font-size: 12px;
  font-weight: medium;
`;

class Button extends React.Component {
    render(){
        return(
         <BigButton></BigButton>
        )
    }
}

export default Button;
